import React, { useEffect } from 'react';
import PropTypes from 'prop-types';
import { Provider } from 'react-redux';
import factory from '../../redux/store';
import { startSession } from '../../redux/actions/session';
import { PDFViewer } from '@react-pdf/renderer';
import InvoiceDoc from './InvoiceDoc';

const InvoiceDocViewer = (props) => {
    const { store } = factory();

    const vieweStyle = {
        width: '700px',
        border: 'none',
        backgroundColor: '#fff',
        height: '100%',
    };
    useEffect(() => {
        () => {
            store.dispatch(startSession());
        };
    });
    return (
        <PDFViewer style={vieweStyle}>
            <Provider store={store}>
                <InvoiceDoc profile={store.getState().profile} />
            </Provider>
        </PDFViewer>
    );
};

InvoiceDocViewer.propTypes = {};

export default InvoiceDocViewer;
